import '../styles/header.css'

function Header() {
    return (
        <div id='header-wrapper'>
            <div id='header'>
                <div id="header-left">
                    <h1>Hostel Management Dashboard</h1>
                </div>
            </div>
        </div>
    );
}


export default Header;
